import './App.css';

function App() {
  return (
    <div>
      <header>
        <img
          src="https://siteglobal.com/themes/custom/site_global/build/images/logos/logo.png"
          alt="logo"
        />
        <nav>
          <a href="#">Home</a>
          <a href="#">Product</a>
          <a href="#">Company</a>
          <a href="#">Contact</a>
        </nav>
      </header>
      <main>
        <img src="https://reactnative.dev/img/logo-og.png" alt="react" />
      </main>
    </div>
  );
}

export default App;
